body.query:
fragment PersonInfoTiny on Person {
  id
  name
  __typename
}

fragment MovieInfoTiny on Movie {
  id
  title
  releaseYear
  directed {
    id {
      ...PersonInfoTiny
      __typename
    }
    __typename
  }
  __typename
}

query GetData($page: Int) {
  storiesPeopleDirectors(page: $page) {
    id
    name
    directed {
      id {
        ...MovieInfoTiny
        __typename
      }
      __typename
    }
    __typename
  }
}
